import React, { useState } from "react";
import { Workbook } from "@fortune-sheet/react";
import "@fortune-sheet/react/dist/index.css";

function FortuneSheetImageInsert() {
  const [sheets, setSheets] = useState([
    {
      name: "Sheet1",
      id: "sheet1",
      celldata: [],
      images: [],
    },
  ]);

  const insertBase64Image = () => {
    // Your base64 image
    const base64Image = "data:image/jpeg;base64,"; // Replace with your actual base64 string
    
    // Get image dimensions from the base64 string
    const img = new Image();
    img.onload = () => {
      const originWidth = img.width;
      const originHeight = img.height;
      
      // Calculate display dimensions (you can adjust these)
      const displayWidth = 300;
      const displayHeight = (originHeight / originWidth) * displayWidth;
      
      // Create the image object following FortuneSheet's structure
      const imageObject = {
        type: "3", // Don't move and resize with cell
        src: base64Image,
        originWidth: originWidth,
        originHeight: originHeight,
        default: {
          width: displayWidth,
          height: displayHeight,
          left: 100, // Position from left
          top: 50,   // Position from top
        },
        crop: {
          width: displayWidth,
          height: displayHeight,
          offsetLeft: 0,
          offsetTop: 0,
        },
        isFixedPos: false,
        fixedLeft: 0,
        fixedTop: 0,
      };

      // Update the sheet data
      setSheets((prevSheets) => {
        const newSheets = [...prevSheets];
        newSheets[0] = {
          ...newSheets[0],
          images: [...(newSheets[0].images || []), imageObject],
        };
        return newSheets;
      });
    };
    
    img.src = base64Image;
  };

  return (
    <div style={{ width: "100%", height: "100vh" }}>
      <div style={{ padding: "10px", background: "#f5f5f5" }}>
        <button
          onClick={insertBase64Image}
          style={{
            padding: "10px 20px",
            backgroundColor: "#4CAF50",
            color: "white",
            border: "none",
            borderRadius: "4px",
            cursor: "pointer",
            fontSize: "14px",
          }}
        >
          Insert Base64 Image
        </button>
      </div>
      
      <div style={{ height: "calc(100vh - 60px)", width: "100%" }}>
        <Workbook
          data={sheets}
          onChange={setSheets}
          showToolbar={false}  // Hide all toolbar
          showFormulaBar={false}  // Optional: hide formula bar too
        />
      </div>
    </div>
  );
}

export default FortuneSheetImageInsert;